import React from 'react';
import styled from 'styled-components';

const StyledSlideThree = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 100vh;

  .image-wrapper {
    position: absolute;
    top: calc(100% / 5);
    right: 120px;
    display: inline-block;

    #map-img {
      height: 60vh;
    }

    #app-img {
      position: absolute;
      right: calc(100% / 2);
      top: 0px;
      right: 0;
      height: 40vh;
    }

    #car-img {
      position: absolute;
      top: 0px;
      right: 0;
      height: 10vh;
    }
  }
`;

function SlideThree() {
  return (
    <StyledSlideThree className="slide-three">
      <div className='image-wrapper'>
        <img id='map-img' src='images/map.png' alt='map of route' />
        <img id='app-img' src='images/app_screen_2.png' alt='mobile device with Eleanor app' />
        <img id='car-img' src='images/silver_car.png' alt='silver sports car' />
      </div>
    </StyledSlideThree>
  );
}

export default SlideThree;
